//輸入rfce可以自動生成跟檔名一樣的快捷函式
import React from 'react'
import Logo from '../Images/design_name.png'

function Navbar() {
  return (
    <div className='navbar'>
        <div className='leftSide'>
            <img src={Logo}/>
        </div>
        <div className='rightSide'></div>
    </div>
  )
}

export default Navbar
